import pandas as pd

def avg_trial_gap(row, df_train: pd.DataFrame, aux_dataframes: Dict[str, pd.DataFrame]):
    trial_data = aux_dataframes['trial_data_table.csv']
    customer_id = row['customer_id']
    trial_dates = trial_data[trial_data['customer_id'] == customer_id]['trial_start_date']
    trial_dates = pd.to_datetime(trial_dates).sort_values()
    if len(trial_dates) < 2:
        return None
    return (trial_dates.diff().dt.days.mean())

